function net_module_protocol_contrast.GetProtocolById(_id)
    for k,v in pairs(net_module_protocol_contrast) do
        if type(v) == "table" then
            if v.pro_con_id == _id then
                return utils.Clone(v)
            end
        end
    end
    return nil
end

